import React from 'react';
import logo from './logo.svg'; // 로고 이미지를 사용합니다.
import './App.css'; // 기본 제공된 CSS를 활용합니다.
import { useNavigate } from 'react-router-dom'; //
import { Routes, Route } from 'react-router-dom';
import Login from './components/login';
import Signup from './components/signup';
function App() {
  // 로그인 페이지를 새 창으로 열기
  const openLogin = () => {
    window.open('/login', '/login');
  };

  // 회원가입 페이지를 새 창으로 열기
  const openSignup = () => {
    window.open('/signup', '_blank');
  };

  let navigate = useNavigate(); //
  return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo"/>
          <p>
            TODO BLOG에 오신 것을 환영합니다!
          </p>
          <div className="btn-box">
            <button onClick={openLogin} className="App-link">로그인</button>
            <button onClick={openSignup} className="App-link">회원가입</button>
            {/* 회원가입 버튼 */}
          </div>
        </header>

      </div>
  );
}

export default App;
